import React, { useState, useEffect } from 'react';
import Papa from 'papaparse';
import { Line, Bar, Pie, Doughnut, Area } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  ArcElement,
  BarElement,
  Filler,
} from 'chart.js';
import { CircleLoader } from 'react-spinners';
import './Dashboard.css';

// Register ChartJS components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
  ArcElement,
  BarElement,
  Filler
);

function Dashboard() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    Papa.parse(
      'https://docs.google.com/spreadsheets/d/e/2PACX-1vSTTSyOvOYmKiGeKXUUzxGWjQ7z9QpoUv1rFM1kkz5g7_vgKNmbiOcZPBQnyQMQCLJcFTS_rJ03KVHD/pub?gid=0&single=true&output=csv',
      {
        download: true,
        header: true,
        dynamicTyping: true,
        complete: (result) => {
          setData(result.data);
          setLoading(false);
        },
      }
    );

    return () => {
      const canvas = document.getElementsByTagName('canvas');
      if (canvas.length > 0) {
        const chart = ChartJS.getChart(canvas[0]);
        if (chart) {
          chart.destroy();
        }
      }
    };
  }, []);

  const engagementData = data.map((entry) => entry['Engagement (%)']);
  const reachData = data.map((entry) => entry['Reach']);
  const impressionsData = data.map((entry) => entry['Impressions']);
  const followersData = data.map((entry) => entry['Followers Gained']);
  const dates = data.map((entry) => entry['Date']);

  const totalInteractions = data.map(
    (entry) => entry['Likes'] + entry['Shares'] + entry['Comments']
  );

  const engagementChartData = {
    labels: dates,
    datasets: [
      {
        label: 'Engagement Rate (%)',
        data: engagementData,
        borderColor: 'rgba(75,192,192,1)',
        fill: false,
        tension: 0.1,
      },
    ],
  };

  const followersChartData = {
    labels: dates,
    datasets: [
      {
        label: 'Followers Gained',
        data: followersData,
        borderColor: 'rgba(153,102,255,1)',
        fill: false,
        tension: 0.1,
      },
    ],
  };

  const reachImpressionsChartData = {
    labels: dates,
    datasets: [
      {
        label: 'Reach',
        data: reachData,
        borderColor: 'rgba(255,99,132,1)',
        fill: false,
        tension: 0.1,
      },
      {
        label: 'Impressions',
        data: impressionsData,
        borderColor: 'rgba(54,162,235,1)',
        fill: false,
        tension: 0.1,
      },
    ],
  };

  const totalCampaignChartData = {
    labels: ['Reach', 'Impressions', 'Followers Gained'],
    datasets: [
      {
        data: [
          reachData.reduce((acc, curr) => acc + curr, 0),
          impressionsData.reduce((acc, curr) => acc + curr, 0),
          followersData.reduce((acc, curr) => acc + curr, 0),
        ],
        backgroundColor: ['rgba(255,99,132,0.2)', 'rgba(54,162,235,0.2)', 'rgba(75,192,192,0.2)'],
        borderColor: ['rgba(255,99,132,1)', 'rgba(54,162,235,1)', 'rgba(75,192,192,1)'],
        borderWidth: 1,
      },
    ],
  };

  // New Metrics (Bar Chart, Donut, Area Chart)
  const impressionsBarChartData = {
    labels: dates,
    datasets: [
      {
        label: 'Impressions by Date',
        data: impressionsData,
        backgroundColor: 'rgba(54,162,235,0.6)',
        borderColor: 'rgba(54,162,235,1)',
        borderWidth: 1,
      },
    ],
  };

  const engagementDonutChartData = {
    labels: ['Positive Engagement', 'Negative Engagement'],
    datasets: [
      {
        data: [75, 25], // Example data
        backgroundColor: ['rgba(75,192,192,0.6)', 'rgba(255,99,132,0.6)'],
        borderColor: ['rgba(75,192,192,1)', 'rgba(255,99,132,1)'],
        borderWidth: 1,
      },
    ],
  };

  const areaChartData = {
    labels: dates,
    datasets: [
      {
        label: 'Reach Over Time',
        data: reachData,
        backgroundColor: 'rgba(75,192,192,0.4)',
        borderColor: 'rgba(75,192,192,1)',
        borderWidth: 1,
        fill: true,
        tension: 0.4,
      },
    ],
  };

  const interactionsLineChartData = {
    labels: dates,
    datasets: [
      {
        label: 'Total Interactions (Likes, Comments, Shares)',
        data: totalInteractions,
        borderColor: 'rgba(255,159,64,1)',
        fill: false,
        tension: 0.1,
      },
    ],
  };

  if (loading) {
    return (
      <div className="loading-container">
        <CircleLoader color="#00BFFF" size={80} />
        <p>Loading data...</p>
      </div>
    );
  }

  return (
    <div className="dashboard-container">
      <h2 className="section-title">Social Media Performance Dashboard</h2>

      <div className="dashboard-section">
        <div className="chart-card">
          <h3>Engagement Rate Over Time</h3>
          <Line data={engagementChartData} />
        </div>

        <div className="chart-card">
          <h3>Followers Gained Over Time</h3>
          <Line data={followersChartData} />
        </div>
      </div>

      <div className="dashboard-section">
        <div className="chart-card">
          <h3>Impressions by Date</h3>
          <Bar data={impressionsBarChartData} />
        </div>

        <div className="chart-card">
          <h3>Total Campaign Performance</h3>
          <Pie data={totalCampaignChartData} />
        </div>
      </div>

      <div className="dashboard-section">
        <div className="chart-card">
          <h3>Engagement Breakdown</h3>
          <Doughnut data={engagementDonutChartData} />
        </div>

        <div className="chart-card">
          <h3>Reach Over Time (Area Chart)</h3>
          <Area data={areaChartData} />
        </div>
      </div>

      <div className="dashboard-section">
        <div className="chart-card">
          <h3>Total Interactions Over Time</h3>
          <Line data={interactionsLineChartData} />
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
